/**
 * @param {string} haystack
 * @param {string} needle
 * @return {number}
 */
var strStr = function(haystack, needle) {
  let res =  -1;
  const nl = needle.length;
  const hl = haystack.length;
  if (nl == 0) return 0;
  if (nl > hl) return(res);
  let j = 0;
  for (let i=0; i < hl - nl + 1; i++){
    let s = haystack.substring(i, i+nl);
    if (s == needle) {
      res = i;
      break;
    }
  }

//  for (let i=0; i<hl; i++){
//    for (j=0; j<needle.length && haystack[i+j] == needle[j]; j++){}
//    if (j==needle.length) {
//      res = i;
//      break;
//    }
//  }
  return(res);
};

